PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "api_person" ("last_login" datetime NULL, "is_superuser" bool NOT NULL, "first_name" varchar(150) NOT NULL, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "date_joined" datetime NOT NULL, "user_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(50) NOT NULL UNIQUE, "name" varchar(40) NOT NULL, "is_active" bool NOT NULL, "password" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "api_visatype" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "visa_type" varchar(100) NOT NULL, "visa_type_description" varchar(200) NOT NULL, "visa_type_duration" integer NOT NULL);
CREATE TABLE IF NOT EXISTS "api_visaapplication" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "form_created" datetime NOT NULL, "name" varchar(100) NOT NULL, "gender" varchar(6) NOT NULL, "occupation" varchar(100) NOT NULL, "civil_status" varchar(20) NOT NULL, "date_of_birth" date NOT NULL, "passport_size_photo" varchar(100) NOT NULL, "passport_issue_country" varchar(100) NOT NULL, "passport_number" varchar(20) NOT NULL, "passport_issue_date" date NOT NULL, "passport_expiry_date" date NOT NULL, "passport_bio_page" varchar(100) NOT NULL, "phone" varchar(15) NOT NULL, "address" varchar(200) NOT NULL, "email" varchar(254) NOT NULL, "visa_duration" integer NOT NULL, "visa_start_date" date NOT NULL, "past_travel_history" varchar(200) NOT NULL, "isApproved" bool NOT NULL, "isProccessing" bool NOT NULL, "isRejected" bool NOT NULL, "isPending" bool NOT NULL, "user_id" integer NOT NULL REFERENCES "api_person" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "api_person" ("user_id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "api_person" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "api_animals" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "compact_description" varchar(200) NOT NULL, "description" text NOT NULL, "image_url" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "api_destination" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "compact_description" varchar(200) NOT NULL, "description" text NOT NULL, "image_url" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "api_events" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "compact_description" varchar(200) NOT NULL, "description" text NOT NULL, "image_url" varchar(200) NOT NULL);
CREATE TABLE IF NOT EXISTS "api_food" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL, "compact_description" varchar(200) NOT NULL, "description" text NOT NULL, "image_url" varchar(200) NOT NULL);
DELETE FROM sqlite_sequence;
CREATE INDEX "api_visaapplication_user_id_cb0cabb9" ON "api_visaapplication" ("user_id");
CREATE INDEX "django_admin_log_content_type_id_c4bce8eb" ON "django_admin_log" ("content_type_id");
CREATE INDEX "django_admin_log_user_id_c564eba6" ON "django_admin_log" ("user_id");
CREATE UNIQUE INDEX "django_content_type_app_label_model_76bd3d3b_uniq" ON "django_content_type" ("app_label", "model");
CREATE UNIQUE INDEX "auth_group_permissions_group_id_permission_id_0cd325b0_uniq" ON "auth_group_permissions" ("group_id", "permission_id");
CREATE INDEX "auth_group_permissions_group_id_b120cbf9" ON "auth_group_permissions" ("group_id");
CREATE INDEX "auth_group_permissions_permission_id_84c5c92e" ON "auth_group_permissions" ("permission_id");
CREATE UNIQUE INDEX "auth_permission_content_type_id_codename_01ab375a_uniq" ON "auth_permission" ("content_type_id", "codename");
CREATE INDEX "auth_permission_content_type_id_2f476e4b" ON "auth_permission" ("content_type_id");
CREATE INDEX "django_session_expire_date_a5c62663" ON "django_session" ("expire_date");
COMMIT;
